import { useState } from "react";

const OperationStep = ({ formData, setFormData }) => {
  // State for dynamic inputs
  const [annualProduction, setAnnualProduction] = useState(
    formData.annualProduction || []
  );
  const [procurementExperience, setProcurementExperience] = useState(
    formData.procurementExperience || []
  );

  // Handle change for basic inputs
  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  // Handle checkbox selection for procurement experience
  const handleProcurementChange = (option) => {
    let updatedExperience = [...procurementExperience];
    if (updatedExperience.includes(option)) {
      updatedExperience = updatedExperience.filter((item) => item !== option);
    } else {
      updatedExperience.push(option);
    }
    setProcurementExperience(updatedExperience);
    setFormData({ ...formData, procurementExperience: updatedExperience });
  };

  // Handle dynamic rows for annual production
  const handleProductionChange = (index, field, value) => {
    const updatedProduction = [...annualProduction];
    updatedProduction[index][field] = value;
    setAnnualProduction(updatedProduction);
    setFormData({ ...formData, annualProduction: updatedProduction });
  };

  const addProductionRow = () => {
    setAnnualProduction([...annualProduction, { product: "", type: "", quantity: "", unit: "", marketValue: "" }]);
  };

  return (
    <div>
      <h2>Step 2: Operation Details</h2>

      <label>Organization Registration *</label>
      <select name="organizationType" value={formData.organizationType || ""} onChange={handleChange}>
        <option value="">Select Type</option>
        <option value="Cooperative">Cooperative</option>
        <option value="Stock Corporation">Stock Corporation</option>
        <option value="Non-stock Corporation">Non-stock Corporation</option>
        <option value="Unregistered">Unregistered</option>
        <option value="Others">Others (Specify Below)</option>
      </select>
      {formData.organizationType === "Others" && (
        <input type="text" name="otherOrganizationType" value={formData.otherOrganizationType || ""} onChange={handleChange} placeholder="Specify type" />
      )}

      <label>Date Established *</label>
      <input type="date" name="dateEstablished" value={formData.dateEstablished || ""} onChange={handleChange} />

      <label>Annual Production</label>
      {annualProduction.map((entry, index) => (
        <div key={index}>
          <input type="text" placeholder="Product" value={entry.product} onChange={(e) => handleProductionChange(index, "product", e.target.value)} />
          <input type="text" placeholder="Type" value={entry.type} onChange={(e) => handleProductionChange(index, "type", e.target.value)} />
          <input type="number" placeholder="Quantity" value={entry.quantity} onChange={(e) => handleProductionChange(index, "quantity", e.target.value)} />
          <input type="text" placeholder="Unit" value={entry.unit} onChange={(e) => handleProductionChange(index, "unit", e.target.value)} />
          <input type="number" placeholder="Market Value" value={entry.marketValue} onChange={(e) => handleProductionChange(index, "marketValue", e.target.value)} />
        </div>
      ))}
      <button type="button" onClick={addProductionRow}>Add Production Row</button>

      <label>Experience in Procurement</label>
      {[
        "Competitive Bidding",
        "Negotiated Procurement",
        "Shopping",
        "Small Value Procurement",
        "Other",
        "No Experience",
      ].map((option) => (
        <div key={option}>
          <input type="checkbox" checked={procurementExperience.includes(option)} onChange={() => handleProcurementChange(option)} />
          <label>{option}</label>
        </div>
      ))}
    </div>
  );
};

export default OperationStep;
